import styled from 'styled-components';
import { VerticalTimeline, VerticalTimelineElement } from 'react-vertical-timeline-component';
import 'react-vertical-timeline-component/style.min.css';
import { FaAws, FaYoutube, FaDiscord } from 'react-icons/fa6'

const Container = styled.div`
    width : 40rem;
    height : 40rem;

    @media only screen and (max-width: 800px) {
        width: 20rem;
        flex-direction : column;
    }
`

function TimeLine() {

    return (
        <Container>
            <VerticalTimeline
                layout='1-column-right'>
                <VerticalTimelineElement
                    className="vertical-timeline-element--work"
                    contentStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
                    contentArrowStyle={{ borderRight: '7px solid  rgb(33, 150, 243)' }}
                    date="22-11-01 ~ ing"
                    iconStyle={{ background: 'rgb(33, 150, 243)', color: '#fff' }}
                // icon={<WorkIcon />}
                >
                    <h3 className="vertical-timeline-element-title">Peppercon</h3>
                    <h4 className="vertical-timeline-element-subtitle">Server Developer</h4>
                    <p>
                        ■ 담당업무 <br />
                        - 전국제패M 서버 API 개발 및 게임 운영툴 개발 <br />
                        - 전국재패M 라이브 서비스 및 컨텐츠 API, 운영툴 업데이트 <br />
                        - WHO AND BE 운영툴 템플릿 제작 <br />
                        <br />
                        ■ 전국제패M <br />
                        - 프로젝트 투입 및 개발기간 : 2022-11-01 ~ 2023-10-05 <br />
                        - 라이브 기간 : 23-04-30 ~ 23-10-05 <br />
                        - 서버 사용 기술 : .Net Framework, nginx, aws, react, aws <br />
                        - 사용 언어 : C# , java script <br />
                        - 담당업무 : <br />
                        - 전국제패M 서버 API 개발 및 게임 운영툴 개발 <br />
                        - 전국재패M 라이브 서비스 및 컨텐츠 API, 운영툴 업데이트 <br />

                        <br />
                        ■ 후앤비 <br />
                        - 프로젝트 투입 및 개발기간 : 2023-10-05 ~ ing <br />
                        - 사용 기술 : blazor <br />
                        - 사용언어 : C# <br />
                        - 담당업무 : 후앤비 게임 운영툴 탬플릿 제작 <br />
                    </p>
                </VerticalTimelineElement>
            </VerticalTimeline>

        </Container>
    )
}

export default TimeLine
